import React from 'react';

function ReportViewer({ reportUrl, result }) {
  const containerRef = React.useRef(null);

  if (!reportUrl) return (
    <div style={{ marginTop: 20 }}>
      <h3 style={{ margin: 0 }}>Execution Report</h3>
      <div style={{ marginTop: 12, color: '#64748b' }}>No report available yet. Run an automation to view results.</div>
    </div>
  );

  const openNew = () => window.open(reportUrl, '_blank');
  const toggleFull = () => {
    const el = containerRef.current;
    if (!el) return;
    if (document.fullscreenElement) document.exitFullscreen();
    else el.requestFullscreen?.();
  };

  return (
    <div style={{ marginTop: 12, width: '100%', display: 'flex', flexDirection: 'column', gap: 12 }}>
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <h3 style={{ margin: 0 }}>Execution Report</h3>
        <div style={{ display: 'flex', gap: 8 }}>
          <button onClick={openNew} style={{ padding: '8px 12px', borderRadius: 8, cursor: 'pointer' }}>Open in new tab</button>
          <button onClick={toggleFull} style={{ padding: '8px 12px', borderRadius: 8, cursor: 'pointer' }}>Toggle Fullscreen</button>
        </div>
      </div>

      <div style={{ display: 'flex', gap: 12 }}>
        <div style={{ width: 320, minWidth: 220, background: '#fff', borderRadius: 8, padding: 12, boxShadow: '0 2px 8px rgba(0,0,0,0.06)' }}>
          <h4 style={{ margin: '0 0 8px 0' }}>Run Summary</h4>
          {result ? (
            <div style={{ fontSize: 13, color: '#334155' }}>
              <div><strong>Status:</strong> {result.status || 'unknown'}</div>
              <div><strong>Exit code:</strong> {result.exitCode ?? '-'}</div>
              <div style={{ marginTop: 8 }}><strong>Report:</strong> <a href={reportUrl} target="_blank" rel="noreferrer">Open</a></div>
              <details style={{ marginTop: 8 }}>
                <summary style={{ cursor: 'pointer' }}>Stdout / Stderr</summary>
                <pre style={{ maxHeight: 200, overflow: 'auto', background: '#f8fafc', padding: 8, borderRadius: 6 }}>{(result.stdout || '') + (result.stderr ? '\nERRORS:\n' + result.stderr : '')}</pre>
              </details>
            </div>
          ) : (
            <div style={{ color: '#64748b', fontSize: 13 }}>No run metadata available yet.</div>
          )}
        </div>

        <div style={{ display: 'flex', flexDirection: 'column', gap: 12, flex: 1 }}>
          <div ref={containerRef} style={{ flex: 1, minHeight: '50vh', maxHeight: '65vh', background: '#fff', borderRadius: 8, overflow: 'hidden', boxShadow: '0 2px 8px rgba(0,0,0,0.06)' }}>
            <iframe
              src={reportUrl}
              title="Execution Report"
              width="100%"
              height="100%"
              style={{ border: 'none', display: 'block', minHeight: '50vh' }}
            />
          </div>

          <div style={{ background: '#fff', borderRadius: 8, padding: 12, boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <h4 style={{ margin: 0 }}>Execution Log</h4>
              <div style={{ display: 'flex', gap: 8 }}>
                <a href={reportUrl.replace('report.html', 'log.html')} target="_blank" rel="noreferrer">Open log in new tab</a>
              </div>
            </div>
            <div style={{ marginTop: 8, height: 260, borderRadius: 6, overflow: 'hidden' }}>
              <iframe
                src={reportUrl.replace('report.html', 'log.html')}
                title="Execution Log"
                width="100%"
                height="100%"
                style={{ border: 'none' }}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ReportViewer;
